import { BrowserRouter as Router, Routes, Route,  } from "react-router-dom";

import "./App.css";
import Navbar from "./Komponensek/Navbar/Navbar";
import Fooldal from "./Komponensek/Oldalak/Fooldal";
import Signup from "./Komponensek/Oldalak/Signup";
import Kapcsolat from "./Komponensek/Oldalak/Kapcsolat";
import Login from "./Komponensek/Oldalak/Login";
import { ShopContextProvider } from "./context/shop-context";
import { Shop } from "./Oldalak/shop/shop";
import { Cart } from "./Oldalak/cart/cart";




function App() {
  return (
    <div className="App">

     <ShopContextProvider>
      <Router>
        <Navbar />
        <Routes>
          <Route path="/fooldal" element={<Fooldal/>}/>
          <Route path="/etlap" element={<Shop/>}/>
          <Route path="/rendeles" element={<Cart/>}/>
          <Route path="/signup" element={<Signup />}/>
          <Route path="/kapcsolat" element={<Kapcsolat/>}/>
          <Route path="/login" element={<Login/>}/>

        </Routes>
        </Router>
        </ShopContextProvider>

    </div>
  );
}

export default App;
